description:
Poser is a virtual photo or film studio. Add the human element to any project - still or animated - without the hassle and cost of using real models and sets.

Poser comes complete with ready-to-pose 3D human figures, hair, clothing, props, scenery, and all the features, lighting and camera effects you need to make something - or someone - extraordinary.


